import React from 'react';
import ReactDOMclient from 'react-dom/client';
// import './index.css';

const helloPrint = () => {
  console.log('hello! onClick');
}

const onMouse = () => {
  console.log('hello! onMouse');
}

3 + 2 === 2 + 3 ? console.log('2+3') : console.log('yo');

let par = 'priv how a u';

function App() {
  return(<div className='App'>
    <input 
    placeholder={par} 
    onClick={helloPrint} 
    onMouseEnter={onMouse}
  />
  </div>);
}

let element = (
  <input 
    placeholder={par} 
    onClick={helloPrint} 
    onMouseEnter={onMouse}
  />
);

// Создаем корень с помощью createRoot

const root = ReactDOMclient.createRoot(document.getElementById('root'));
root.render(element);
